Plot: After three weeks of chatting with the thirty-two year old photographer Jeff Kohlver over the Internet, fourteen year old Hayley Stark meets him in the Nighthawks coffee shop. Hayley flirts with him in spite of the age difference and proposes to go to his house. Once there, she prepares a screwdriver for them and Jeff passes out. When he awakes, he is tied up to a chair, and Hayley accuses him of pedophilia. Jeff denies the accusation, and Hayley begins to torture him in a cat and mouse game.
